const Table = ({ spot }) => {
  return (
    <div className="container">
      <h1>Simple Inventory Table</h1>
      <table>
        <thead>
          <tr>
            <th>Product Name</th>
            <th>Product Category</th>
            <th>Unit Price</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {Array.isArray(spot)
            ? spot.map((spot) => (
                <tr key={spot.id}>
                  <td>{spot.name}</td>
                  <td>{spot.country}</td>
                  <td>{spot.month}</td>
                  <td />
                </tr>
              ))
            : null}
        </tbody>
      </table>
    </div>
  );
};

export default Table;

